import React from 'react';
import Header from "./component/Header";
import Footer from "./component/Footer";
import Home from "./component/home/Home";
import {Router} from "react-router-dom";
function App() {
  return (
    <div className={"App"}>
        <Header/>
        <Home/>
        <Footer/>
    </div>
  );
}

export default App;
